import Serviços from "./Serviços";
import Wchart from "./Wchart";
import '../css/main.scss'
import Pchart from "./Pchart";
const Main = () => {
    return (
        <main className="container">
           <section className="">
               <Wchart/>
               <section className="grid1">
                <Pchart/>
                <Serviços/>
                </section>
           </section>
        </main>
      );
}
 
export default Main;
